create table log_table(
  sentence text
);

create table product(
  id serial primary key,
  price int not null, -- 상품 가격 
  seller int not null, -- 판매자 아이디 
  name varchar(100) not null, -- 상품명 
  num_stock int not null -- 상품 재고 수
);


create table seller(
  id serial primary key,
  name varchar(100) not null  -- 판매자명 
);



create table ordered(
  id serial primary key,
  product_id int not null,  -- 상품 아이디
  amount int not null,  -- 주문 상품 갯수
  order_date timestamp not null  -- 주문일자
);

create table covid(
  id serial primary key,
  datadate timestamp,  
  country varchar(100), 
  new_cases int,
  new_deaths int,
  total_cases int,
  total_deaths int
);

